function statHalfDonut(t,e){nv.addGraph(function(){var n=400,a=380,r=nv.models.pieChart().x(function(t){return t.key}).showLabels(!1).width(n).height(a).donut(!0);return r.pie.startAngle(function(t){return t.startAngle/2-Math.PI/2}).endAngle(function(t){return t.endAngle/2-Math.PI/2}),d3.select("#"+t).datum(JSON.parse(e)).transition().duration(1200).attr("width",n).attr("height",a).call(r),r})}function statBar(t,e,n){nv.addGraph(function(){var a=400,r=380,i=nv.models.discreteBarChart().x(function(t){return t.label}).y(function(t){return t.value}).width(a).height(r).staggerLabels(!0).showValues(!1);return d3.select("#"+t).datum([JSON.parse(e)]).attr("height",r).call(i).attr("width",a).attr("height",r),d3.select("#"+t).append("text").attr("x",200).attr("y",12).attr("text-anchor","middle").style("font-weight","bold").text(n),nv.utils.windowResize(i.update),i})}